        file_name_length = file_name_length + (ulong)is_negative * -2 + 1;
        new_path = new_path + (ulong)is_negative * -2 + 1;
      }
      for (; remaining_size != 0; remaining_size = remaining_size - 1) {
        *new_path = *file_name;
        file_name = file_name + (ulong)is_negative * -2 + 1;
        new_path = new_path + (ulong)is_negative * -2 + 1;
      }
      last_slash[total_size] = '\0';
      return last_slash;
    }
  }
  error_message = dcgettext(0,"Out of memory\n",5);
  display_error(error_message);
  return (char *)0x0;
}
